import React from "react";

import Container from '../components/Container'
import Header from "../components/Header";
import Footer from "../components/Footer";

const Home = () => (

    <>
    <Header/>
    <Container>
        <h1>
            Home
        </h1>
    </Container>
    <Footer/>
    </>

)

export default Home
